import React from "react";
import {
  LinkHeaderText,
  LinkColumnContainer,
  LinkContent,
  LinkContentText,
} from "./LinkSectionFooter.style";

interface Props {
  data: {
    header: string;
    content: string[];
  };
}

const LinkColumn: React.FC<Props> = ({ data }) => {
  return (
    <LinkColumnContainer>
      <LinkHeaderText>{data.header}</LinkHeaderText>
      <LinkContent>
        {data.content.map((ele) => {
            console.log()
          return <LinkContentText>ele</LinkContentText>;
        })}
      </LinkContent>
    </LinkColumnContainer>
  );
};
export default LinkColumn;
